import { Form, Link } from "react-router-dom";
import  {Cards}  from "/Cards";

export default function Home(){
    return(<div>
        <nav style={{display:"flex",justifyContent:"space-around",alignItems:"center",color:"white",height:"50px",
    backgroundColor: "rgb(82, 113, 141)"}}> <h1 className="logo">Home</h1>
        <Link to="/Dashbord" className="h1" > Admin </Link>   
             <Link to="/Register" className="h1" > LOG OUT </Link>
</nav>
<Cards />

    </div>)
}
